import React from 'react';
function AgregarUsuarios(){
    return (
        <div className='container'>
            <div className='row'>
            <h2>Agregar usuarios</h2>
            
        </div>
        <div className='row'>
            <div className='col-sm-6 offset-3'>
                <div className='mb-3'>
                    <label htmlFor="nombre" class></label>


                </div>


            </div>
         
            
        </div>
        </div>
    )
}
export default AgregarUsuarios;
